                            " The public aspect includes public acceptance of ministerial candidates who will join\nthe cabinet. The president is elected not only by political parties but also by the peoples trust.\nTherefore, the publics expectations expressed in various discussions about cabinet formation should\nbe considered by the President as input on what the public wants for how the cabinet should operate."
